 * Body
 * - Search Bar
 * - RestaurantCard
 *    - Image
 *    - Name
 *    - Rating
 *    - Cuisines
 *
 * Footer
 *    - links
 *    - copyright
 */

// Config driven UI
const AppLayout = () => {
  return (
    <React.Fragment>
      <Header />
      {/* <Title /> */}
      {/* <React.Fragment> */}
      {/* <Body /> */}
      <Outlet />
      <Footer />
      {/* </React.Fragment> */}
    </React.Fragment>
  );
};

function App() {
  return <AppLayout />;
}

export default App;
